import React from 'react';

function Experience() {
  return (
    <section id="experience" className="experience">
      <h2>Experience</h2>
      <div className="timeline">
        <div className="timeline-item" data-year="2023 - 2024">
          <h3>Graduate Research Assistant - Wichita State University </h3>
          <p>Led research on indoor navigation systems using Bluetooth beacons, MS SQL, and Azure SQL to assist visually and mobility-impaired users. Designed a user interface with OpenStreetMap and React Native, providing real-time data synchronization and enhancing accessibility.</p>
        </div>
        <div className="timeline-item" data-year="2023 - 2024">
          <h3>Graduate Teaching Assistant - Wichita State University</h3>
          <p>Taught and mentored students in Computer Networks and Wireless Networking, overseeing practical work in areas such as capture-the-flag competitions. Focused on delivering interactive learning and developing innovative teaching methods for complex technical subjects.</p>
        </div>
      </div>
    </section>
  );
}

export default Experience;
